import { Box, makeStyles, Typography } from '@material-ui/core';
import * as React from 'react';

interface Props {
  text: string
}

const useStyles = makeStyles({
  root: {
    position: 'fixed',
    top: 0,
    left: 0,
    minWidth: '100vw',
    minHeight: '100vh',
    background: 'rgba(50,0,0,0.25)',
    pointerEvents: 'none'
  }
});

export const ByoaSDK = ({ text }: Props) => {
  const classes = useStyles();

  return (
    <Box className={classes.root}>
      <Typography variant='h1'>Comp: {text}</Typography>
    </Box>
  )
}
